import styled  from 'styled-components';



const Imagen = styled.div`
    background-size: cover;
    width: 250px;
    height: 250px;
    background-position: center;
    margin: auto;
`


const H2 = styled.h2`
    font-size: 1.8rem;
    font-weight: 600;
    padding: 1rem;
`
const Lastblog = () => {
    return ( 
        <div className="container mt-5 mb-5">
            <div className="row">
                <div className="col-8">
                <div className="container">
                <div className="row">
                    <div className="col-6">
                    1blog
                    </div>
                    <div className="col-6">
                    2blog
                    </div>
                </div>
            </div>
                </div>
                <div className="col-4">
                    sidebar
                    
                </div>
            </div>
        </div>
     );
}
 
export default Lastblog;
